    "2016-05-25T00:53:03.383151",nt"name": "weather-camera",nt"isopen":
    true,nt"url": null,nt"notes": "Weather Camera (WCAM) is a system that  provides
    supplementary weather information to pilots for enhanced situational awareness of
    current weather conditions via a camera. WCAMs are installed to provide images of
    sky conditions near airports and strategic en route locations.  Depending upon geography,
    a WCAM site could have from one to four cameras aimed to give the best indication
    of the weather in the direction most relevant to VFR traffic. Images are provided
    to the public via the internet using a user-friendly, web-enabled system.  Images
    are updated about every 10 minutes and are stored for viewing historic conditions.",nt"license_title":
